import React from 'react';
import Login from './pages/Login';
import { BrowserRouter, Route } from 'react-router-dom';

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <Route path="/" render={() => <Login />} />
      </BrowserRouter>
    );
  }
}

export default App;
